import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { Cart, Moon } from "react-bootstrap-icons";

const Header = () => {
  return (
    <Navbar
      expand="lg"
      style={{
        background: "linear-gradient(180deg, #0a1c54,#051d58)",
        padding: "0.5rem 1rem",
      }}
      variant="dark"
    >
      <Container fluid>
        {/* Logo & Brand */}
        <Navbar.Brand
          href="#home"
          className="d-flex align-items-center"
          style={{ color: "white", fontWeight: "bold" }}
        >
          <img
            alt="logo"
            src="https://via.placeholder.com/40x40" // replace with your logo
            style={{ marginRight: "10px" }}
          />
          Fulltime-Predict.com
        </Navbar.Brand>

        {/* Collapse Toggle */}
        <Navbar.Toggle aria-controls="basic-navbar-nav" />

        {/* Links */}
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mx-auto">
            <Nav.Link href="#home" style={{ color: "white" }}>
              Home
            </Nav.Link>
            <Nav.Link href="#football" style={{ color: "white" }}>
              Football
            </Nav.Link>
            <Nav.Link href="#basketball" style={{ color: "white" }}>
              Basketball
            </Nav.Link>
            <Nav.Link href="#hockey" style={{ color: "white" }}>
              Hockey
            </Nav.Link>
          </Nav>

          {/* Icons */}
          <Nav className="ms-auto d-flex align-items-center">
            <Nav.Link href="#cart" style={{ color: "white" }}>
              <Cart size={20} />
            </Nav.Link>
            <Nav.Link href="#dark" style={{ color: "white" }}>
              <Moon size={20} />
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
